import React from "react";

import Header from "../Partes/Header";
import Aside from "../Partes/Aside";
import Footer from "../Partes/Footer";

export default function Geral(props){
    return(
        <div>
            <Header/>
                <div>
                    <Aside />
                    <div className="conteudo">
                        {props.children}
                    </div>
                </div> 
            <Footer />
        </div>

    );
}
